		System.out.println("\n\n esta encriptado base 64? "+Base64.isArrayByteBase64("CORTE NACIONAL DE JUSTICIA. - SALA ESPECIALIZADA DE LO CONTENCIOSO ADMINISTRATIVO. , VISTOS: En virtud de que: A) El Juez Nacional Dr. lvaro Ojeda Hidalgo ha sido designado por el Consejo de la Judicatura de Transicin mediante resolucin No. 4-2012 de 25 de enero del 2012; y, la Jueza y Juez Nacionales, Ab. Cynthia Guerrero Mosquera y Dr. Pablo Tinajero Delgado, han sido designados por el Consejo de la Judicatura mediante resolucin No. 341-2014 de 17 de diciembre de 2014. B) El Pleno de la Corte Nacional de Justicia mediante resoluciones No. 1-2015 de 28 de enero de 2015 y No. 1-2018 de 26 de enero de 2018, nos design para integrar esta Sala Especializada. C) Somos el tribunal competente y conocemos la presente causa de apelacin de accin de hbeas-corpus, conforme el artculo 169 numeral 1 de la Ley Orgnica de Garantas Jurisdiccionales y Control Constitucional (LOGJCC) y el acta de sorteo de 5 de febrero de 2019. Al respecto se considera: PRIMERO.- 1.1.- Mediante sentencia de 21 de enero de 2019, 9h05, la Sala Multicompetente de la Corte Provincial de Justicia de Imbabura en lo principal resolvi: El da martes 8 de enero del 2019, han comparecido los ciudadanos Jefferson Bayardo Ichau y Wilman David Ichau presentando accin constitucional de hbeas Corpus en contra de la Jueza Bella Pepita Garcs, Jueza de la Unidad Judicial Violencia Contra la Mujer o Miembros del Ncleo familiar de Ibarra, porque dicen, que en la investigacin No. 10010181800642 aperturada en Fiscala, por un supuesto delito de violacin, se ha dispuesto su detencin para fines investigativos, con lo que se ha puesto en riesgo su libertad ambulatoria porque se trata de una orden arbitraria e ilegtima Decisin judicial impugnada. Es la providencia emitida el 26 de noviembre del 2018, a las 10h48 por la Jueza Bella Pepita de Lourdes Garcs Bucheli, de la Unidad de Violencia contra la Mujer o Miembros del Ncleo Familiar de Ibarra, en cuya parte pertinente dice VISTOS: ...El artculo 195 de la Constitucin de la Repblica del Ecuador, otorga a la Fiscala General del Estado a travs de sus fiscales, la obligacin de dirigir de oficio o a peticin de parte, la investigacin pre procesal, con especial atencin a los derechos de las vctimas. Del contenido del oficio se desprende que en contra de los ciudadanos: SILVIO TOMS ICHAU ICHAU, WILMAN DAVID ICHAU CACUANGO, ALEX JEFFERSON MATANGO ICHAU Y JEFFERSON BAYARDO ICHAU ICHAU, existiran elementos de conviccin graves y concordantes sobre sus participaciones en el delito de violacin, por lo que, la ley prev que cuando haya presuncin de un delito de accin pblica, se puede proceder con la detencin con fines investigativos, conforme lo establecen los artculos 530, 531 y 532 del COIP. Siendo sta un herramienta de la cual la Fiscala puede utilizar a fin de investigar a una persona, cuando en contra de ella haya presunciones de responsabilidad, el Fiscal puede solicitar al juez que la disponga, sin que esta detencin, lesione el ordenamiento jurdico y normativo de la Repblica del Ecuador; es decir, est plenamente contemplado en la Ley y en la Constitucin. La misma normativa, establece que la detencin no podr ser por ms de 24 horas, la versin que se la tome, debe hacerse ante la presencia del defensor pblico, a fin de garantizar los derechos y garantas establecidos en la Constitucin de la repblica del Ecuador, cuya seguridad jurdica es la garanta que el Estado reconoce a los ciudadanos para que su integridad, sus derechos y sus bienes no sean vulnerados y que, en caso que esto se produzca, se establezcan los mecanismos adecuados para su tutela. Con este antecedente, y ante el pedido formulado por la seora Fiscal, recalco a los seores responsables de la investigacin, que las garantas constitucionales son normas, mecanismos jurdicos de proteccin de los ms elementales derechos del hombre para evitar cualquier vulneracin de los mismos. Con las consideraciones expuestas, se ordena la detencin de los ciudadanos: SILVIO TOMAS ICHAU ICHAU; WILMAN DAVID ICHAU CACUANGO, ALEX JEFFERSON MATANGO ICHAU, Y, JEFFERSON BAYARDO ICHAU ICHAU, con fines investigativos por el lapso de 24 horas... La Jueza Bella Pepita de Lourdes Garcs Bucheli, al disponer la detencin de los ciudadanos Wilman David Ichau Cacuango y Jefferson Bayardo Ichau Ichau, por veinticuatro horas, con fines investigativos, ha vulnerado el derecho a la libertad?... De la constatacin de la documentacin anexada a su accin por parte de los accionantes, esto es la providencia emitida por la Jueza Bella Pepita Garcs, de fecha 26 de noviembre del 2018 de las 10h48 (fs. 34) de la cual se dice que se ha pedido la revocatoria y ha sido negada, se puede apreciar que la misma rene las condiciones de constitucionalidad y legalidad porque ha sido dictada por juez competente y se encuentra debidamente motivada conforme las exigencias del artculo 76.7 letra 1), en concordancia con los artculos 530, 531 y 532 del Cdigo Orgnico de la Funcin Judicial. Si por mandato constitucional y legal, la Fiscala es la titular de la accin penal pblica y de manera motivada ha solicitado la detencin con fines investigativos de los accionantes, pues ha de ser dicha autoridad la que pueda evaluar la forma de hacer comparecer a cualquier persona sospecha (sic) de un delito y solicitar al juez que se la dicte o se la deje sin efecto. No puede desnaturalizarse, por tanto, la accin de hbeas corpus, pretendindose que los jueces en materia constitucional revoquen una providencia judicial sobre la base de una anlisis eminentemente legal. Cierto es que existe abundante jurisprudencia internacional -como dijo la defensa de los accionantes- que somete a los Estados a la observancia de los derechos humanos, pero no es menos cierto tambin que la soberana de un Estado radica en la observancia -por parte de las autoridades- de las normas constitucionales y legales para  privar de la libertad a una persona. El artculo 532 le pone lmites al juez, y ese lmite es que no puede ser mayor a veinticuatro horas, la Jueza accionada, ha dispuesto la privacin de la libertad de los accionantes por veinticuatro horas, entonces, su decisin se enmarca en el mbito establecido por la Constitucin y la ley, deviniendo por tanto en legalmente emitida; es decir, no se ha actuado de manera arbitraria ni ilegitima, la jueza tiene su condiciona (sic) de tal y ha aplicado un ordenamiento jurdico limitativo de la privacin de la libertad. En lo que respecta a la accin de hbeas corpus, conforme a lo dispuesto en el artculo 89 de la Constitucin, esta \"...tiene por objeto recuperar la libertad de quien se encuentra privado de ella de forma ilegal, arbitraria o ilegitima, por orden de autoridad pblica o de cualquier persona, as como proteger la vida y la integridad fsica de las personas privadas de libertad\". En similares trminos, la Ley Orgnica de Garantas Jurisdiccionales y Control Constitucional, en el artculo 43 establece que \"La accin de hbeas corpus tiene por objeto proteger la libertad, la vida, la integridad fsica y otros derechos conexos de la persona privada o restringida de libertad, por autoridad pblica o por cualquier persona... Declarar que en la orden de detencin para investigaciones por veinticuatro horas de los ciudadanos Wilman David Ichau Cacuango y Jefferson Bayardo Ichau Ichau, constante en la providencia de 26 de noviembre del 2018 de las 10h48, no se ha vulnerado el debido proceso ni se ha atentado contra su libertad ambulatoria. Declarar improcedente la demanda constitucional de habeas (sic) corpus propuesta por los antedichos ciudadanos, por carecer de fundamento sustancial constitucional, es decir, la orden de detencin para investigaciones, ha sido dictada por autoridad competente sobre la base de una normativa jurdica constitucional y legal vigente en el Ecuador.. 1.2.- El artculo 89 de la Constitucin de la Repblica establece que: La accin de hbeas corpus tiene por objeto recuperar la libertad de quien se encuentre privado de ella de forma ilegal, arbitraria o ilegtima, por orden de autoridad pblica o de cualquier persona, as como proteger la vida y la integridad fsica de las personas privadas de libertad. SEGUNDO.- Es imprescindible tener en cuenta en el presente caso, que el recurso de apelacin que consta a fojas 59 del proceso no tiene ninguna fundamentacin, pues se limita a sealar que: La accin de hbeas corpus presentada en contra de la providencia emitida el 26 de noviembre del 2018, a las 10h48 por la Jueza Bella Pepita de Lourdes Garcs Bucheli, de la Unidad de Violencia contra la Mujer o Miembros del Ncleo Familiar de Ibarra, se esgrimi en virtud de que no obstante haber sido dictada por una autoridad competente y en base a lo dispuesto en los artculos 530, 531 y 532 del COIP es arbitraria e incumple con lo dispuesto en el Art. 7, numeral 3 de la Convencin Americana sobre de Derechos Humanos. Al respecto debemos manifestar que, la Corte Interamericana de Derechos Humanos ha reiterado en su jurisprudencia que nadie puede ser sometido a detencin o encarcelamiento por causas y mtodos que -an calificados de legales- puedan reputarse como incompatibles con el respeto a los derechos fundamentales del individuo por ser, entre otras cosas, irrazonables, imprevisibles, o faltos de proporcionalidad. (lo resaltado nos pertenece). Razonabilidad, previsibilidad y proporcionalidad que no existe en la decisin de la Dra. Bella Pepita de Lourdes Garcs Bucheli de mantener vigente una orden de detencin con fines investigativos, pese a que nosotros hemos informado que jams nos notificaron con el inicio de alguna investigacin en nuestra contra, y que al habernos enterado de este particular es nuestra decisin, comparecer al proceso investigativo a aclarar y colaborar con la indagacin sin necesidad de que nos priven de nuestra libertad. Por lo expuesto y por cuanto en la sentencia dictada el 21 de enero de 2019, a las 9H05 sus autoridades desechan nuestra accin agotando su argumento nicamente en que la decisin impugnada es legal por enmarcarse en la ley y ser dictada por una autoridad competente, sin ampliar su motivacin a la arbitrariedad del acto impugnado, que es lo que se puso en conocimiento de la administracin de justicia constitucional; fundamentados en el Art. 44, numeral 4 de la Ley de Garantas Jurisdiccionales y Control Constitucional, en concordancia con el Art. 76, numeral 7, literal m de la Constitucin de la Repblica y lo dispuesto en la resolucin s/n, de la Corte Nacional de Justicia, de 23 de marzo de 2009, publicada en el Registro Oficial Nro. 565 de 7 de abril de 2009, presentamos RECURSO DE APELACIN de la sentencia antes sealada.. TERCERO.- 3.1.- La doctrina procesal es clara en lo que realmente implica una fundamentacin del recurso de apelacin, sealndose que: Memorial y expresin de agravios.- Por el recurso libre se presenta un escrito de fundamentacin llamado expresin de agravios. Por el recurso en relacin se presenta un escrito llamado memorial. La distincin entre uno y otro carece de sentido y deviene de una cuestin histrica. Tanto uno como otro importan una crtica concreta y razonada de las partes del fallo que el apelante considere equivocadas. No bastar remitirse a presentaciones anteriores. Esta crtica representa un ataque tendiente a la destruccin del fallo en la parte que el apelante entiende que lo perjudica. Las partes del fallo no atacadas quedan firmes y pueden dar lugar a la ejecucin parcial. El hecho de que la crtica sea razonada, importa que debe contener fundamentos y una explicacin lgica de por qu el juez ha errado en su decisin. Sin expresin de agravios o memorial, el recurso se considera desierto y la resolucin atacada queda firme. La crtica debe dirigirse o bien a la fijacin de los hechos, o a la aplicacin del derecho, o a ambos.. Enrique M. Falcn, Manual de Derecho Procesal, tomo 2, (Buenos Aires: Astrea, 2005), 24. (Lo resaltado nos pertenece).  3.2.- Igualmente: Trmite de apelacin de autos.-El traslado es una oportunidad concedida a las partes para que le expongan al ad quem las razones que tengan sobre la decisin recurrida. Tiene especial importancia para que el recurrente exprese el objeto de la apelacin, sea para modificar o revocar la decisin El apelante tiene la carga de sustentar el recurso, so pena de que se declare desierto.. Jaime Azula Camacho, Manual de Derecho Procesal, 8 ed., (Bogot: Temis S.A., 2011), 356. (Lo resaltado nos  pertenece). 3.3.- En el recurso de apelacin presentado no existe ningn intento de fundamentacin, pues simplemente sealar, en trminos completamente generales, que lo actuado respecto a la orden de detencin con fines investigativos dentro de la investigacin No. 10010181800642 por la jueza Dra. Bella Pepita de Lourdes Garcs Bucheli, Jueza de la Unidad Judicial Violencia Contra la Mujer o Miembros del Ncleo familiar de Ibarra, adolecera de falta de razonabilidad, previsibilidad y proporcionalidad no es fundamentar nada, pues el apelante debera explicar de manera concreta cmo tales situaciones se habran dado y cmo los jueces provinciales en la sentencia impugnada omitieron considerar tales particulares; en el presente caso simplemente no se puede conocer cul es el objeto de la apelacin, esto es qu exactamente se impugna, pues no existe ninguna crtica concreta y razonada de las partes del fallo de instancia que los apelantes y/o su abogado consideren equivocadas, lo cual refleja una falta de seriedad procesal en la interposicin del recurso de apelacin de hbeas corpus, al cual parecera ser que en la presente causa ms bien se le ha intentado dar una especie de tratamiento procesal como si de una especie de recurso de apelacin en materia penal se tratase, por lo cual este Tribunal estara de acuerdo con lo manifestado por los jueces provinciales de que no puede desnaturalizarse la accin de hbeas corpus pretendindose que los jueces en materia constitucional revoquen una providencia judicial sobre la base de una anlisis eminentemente legal, respecto a la pertinencia o no de una orden de detencin con fines investigativos expedida por una o un juez en ejercicio de sus funciones en temas de ndole penal, lo cual evidentemente desnaturaliza la accin de hbeas corpus. Sin que sean necesarias ms consideraciones, este Tribunal, ADMINISTRANDO JUSTICIA, EN NOMBRE DEL PUEBLO SOBERANO DEL ECUADOR, Y POR AUTORIDAD DE LA CONSTITUCIN Y LAS LEYES DE LA REPBLICA, rechaza el recurso de apelacin interpuesto, pues no se constata que se haya trasgredido el artculo 89 de la Constitucin de la Repblica, y se confirma la sentencia de 21 de enero de 2019, 9h05, expedida por la Sala Multicompetente de la Corte Provincial de Justicia de Imbabura. Notifquese, devulvase y publquese.".getBytes()));
		
		

